INSERT INTO `wp_posts` VALUES (6,1,'2022-06-01 12:28:38','2022-06-01 12:28:38','<!-- wp:kadence/rowlayout {\"uniqueID\":\"_3d4c34-c8\",\"columnGutter\":\"none\",\"colLayout\":\"equal\",\"htmlTag\":\"section\",\"minHeight\":55,\"maxWidth\":1200,\"topPadding\":50,\"bottomPadding\":84,\"bgColor\":\"palette1\",\"bgImg\":\"http://carekleen.local/wp-content/uploads/2022/06/bg-slider4-1.png\",\"bottomSep\":\"wave\",\"minHeightUnit\":\"vh\",\"columnsInnerHeight\":true,\"minHeightTablet\":100,\"bgColorClass\":\"theme-palette1\"} -->\n<section class=\"wp-block-kadence-rowlayout alignnone\"><div id=\"kt-layout-id_3d4c34-c8\" class=\"kt-row-layout-inner kt-row-has-bg kt-layout-id_3d4c34-c8 has-theme-palette-1-background-color\"><div class=\"kt-row-column-wrap kt-has-2-columns kt-gutter-none kt-v-gutter-default kt-row-valign-top kt-row-layout-equal kt-tab-layout-inherit kt-m-colapse-left-to-right kt-mobile-layout-row kt-inner-column-height-full\"><!-- wp:kadence/column {\"uniqueID\":\"_277e48-bf\",\"textAlign\":[\"left\",\"\",\"\"],\"direction\":[\"vertical\",\"\",\"\"],\"justifyContent\":[\"\",\"\",\"\"]} -->\n<div class=\"wp-block-kadence-column inner-column-1 kadence-column_277e48-bf\"><div class=\"kt-inside-inner-col\"><!-- wp:heading {\"level\":1,\"textColor\":\"theme-palette9\"} -->\n<h1 class=\"has-theme-palette-9-color has-text-color\">Industrial &amp; commercial cleaning services that you can trust.</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":\"21px\"}},\"textColor\":\"theme-palette9\"} -->\n<p class=\"has-theme-palette-9-color has-text-color\" style=\"font-size:21px\">Residential &amp; commercial cleaning services that you can trust. We are committed to the best quality in industrial cleaning, residential cleaning, and garden cleaning.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:block {\"ref\":47} /--></div></div>\n<!-- /wp:kadence/column -->\n\n<!-- wp:kadence/column {\"id\":2,\"uniqueID\":\"_12ce61-76\"} -->\n<div class=\"wp-block-kadence-column inner-column-2 kadence-column_12ce61-76\"><div class=\"kt-inside-inner-col\"></div></div>\n<!-- /wp:kadence/column --></div><div class=\"kt-row-layout-bottom-sep kt-row-sep-type-wave\"><svg style=\"fill:#ffffff\" viewBox=\"0 0 1000 100\" preserveAspectRatio=\"none\"><path d=\"M1000,40c0,0 -120.077,-38.076 -250,-38c-129.923,0.076 -345.105,78 -500,78c-154.895,0 -250,-30 -250,-30l0,50l1000,0l0,-60Z\"></path></svg></div></div></section>\n<!-- /wp:kadence/rowlayout -->\n\n<!-- wp:kadence/rowlayout {\"uniqueID\":\"_4b5cae-00\",\"colLayout\":\"equal\",\"htmlTag\":\"section\",\"leftPaddingM\":15,\"rightPaddingM\":15} -->\n<section class=\"wp-block-kadence-rowlayout alignnone\"><div id=\"kt-layout-id_4b5cae-00\" class=\"kt-row-layout-inner kt-layout-id_4b5cae-00\"><div class=\"kt-row-column-wrap kt-has-2-columns kt-gutter-default kt-v-gutter-default kt-row-valign-top kt-row-layout-equal kt-tab-layout-inherit kt-m-colapse-left-to-right kt-mobile-layout-row\"><!-- wp:kadence/column {\"uniqueID\":\"_1a1797-88\"} -->\n<div class=\"wp-block-kadence-column inner-column-1 kadence-column_1a1797-88\"><div class=\"kt-inside-inner-col\"><!-- wp:image {\"id\":77,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://carekleen.local/wp-content/uploads/2022/06/image-5.png\" alt=\"\" class=\"wp-image-77\"/></figure>\n<!-- /wp:image --></div></div>\n<!-- /wp:kadence/column -->\n\n<!-- wp:kadence/column {\"id\":2,\"uniqueID\":\"_893f33-09\",\"textAlign\":[\"left\",\"\",\"\"]} -->\n<div class=\"wp-block-kadence-column inner-column-2 kadence-column_893f33-09\"><div class=\"kt-inside-inner-col\"><!-- wp:kadence/advancedheading {\"uniqueID\":\"_934382-58\",\"bottomMargin\":0,\"htmlTag\":\"p\",\"className\":\"section-intro\"} -->\n<p class=\"kt-adv-heading_934382-58 section-intro wp-block-kadence-advancedheading\" data-kb-block=\"kb-adv-heading_934382-58\">About Carekleen</p>\n<!-- /wp:kadence/advancedheading -->\n\n<!-- wp:heading -->\n<h2>Why Choose Us?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Carekleen specialises in commercial cleaning services in Melbourne for small and large businesses. We deliver a wide range of cleaning services, ensuring a safe and efficient handling of your site by our reliable, competent and well-trained professionals.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:kadence/advancedheading {\"uniqueID\":\"_f9c005-5d\",\"align\":\"left\",\"bottomMargin\":30,\"padding\":[\"\",\"\",\"\",\"\"],\"htmlTag\":\"p\",\"link\":\"http://carekleen.local/sample-page/\",\"linkStyle\":\"underline\",\"linkColor\":\"palette3\"} -->\n<a href=\"http://carekleen.local/sample-page/\" class=\"kb-advanced-heading-link kt-adv-heading-link_f9c005-5d hls-underline\"><p class=\"kt-adv-heading_f9c005-5d wp-block-kadence-advancedheading\" data-kb-block=\"kb-adv-heading_f9c005-5d\">Learn more about us</p></a>\n<!-- /wp:kadence/advancedheading -->\n\n<!-- wp:kadence/iconlist {\"items\":[{\"icon\":\"fas_check-circle\",\"link\":\"\",\"target\":\"_self\",\"size\":15,\"width\":2,\"text\":\"For your safety, Carekleen is fully insured by public liability insurance.\",\"color\":\"\",\"background\":\"\",\"border\":\"\",\"borderRadius\":0,\"padding\":5,\"borderWidth\":1,\"style\":\"stacked\",\"level\":0},{\"icon\":\"fas_check-circle\",\"link\":\"\",\"target\":\"_self\",\"size\":15,\"width\":2,\"color\":\"\",\"background\":\"\",\"border\":\"\",\"borderRadius\":0,\"borderWidth\":1,\"padding\":5,\"style\":\"stacked\",\"level\":0,\"text\":\"All our cleaners are covered with national police clearance and hold working with children check cards.\"},{\"icon\":\"fas_check-circle\",\"link\":\"\",\"target\":\"_self\",\"size\":15,\"width\":2,\"color\":\"\",\"background\":\"\",\"border\":\"\",\"borderRadius\":0,\"borderWidth\":1,\"padding\":5,\"style\":\"stacked\",\"level\":0,\"text\":\"Customer satisfaction is guaranteed. Feedback and suggestions are welcomed.\"},{\"icon\":\"fas_check-circle\",\"link\":\"\",\"target\":\"_self\",\"size\":15,\"width\":2,\"color\":\"\",\"background\":\"\",\"border\":\"\",\"borderRadius\":0,\"borderWidth\":1,\"padding\":5,\"style\":\"stacked\",\"level\":0,\"text\":\"Discounts for recurring clients, complementary addons with annual contracts.\"}],\"listCount\":4,\"listGap\":25,\"uniqueID\":\"_a94c73-ec\",\"iconAlign\":\"top\"} -->\n<div class=\"wp-block-kadence-iconlist kt-svg-icon-list-items kt-svg-icon-list-items_a94c73-ec kt-svg-icon-list-columns-1 alignnone kt-list-icon-aligntop\"><ul class=\"kt-svg-icon-list\"><li class=\"kt-svg-icon-list-style-stacked kt-svg-icon-list-item-wrap kt-svg-icon-list-item-0 kt-svg-icon-list-level-0\"><div style=\"display:inline-flex;justify-content:center;align-items:center;padding:5px;border-width:1px\" class=\"kt-svg-icon-list-single kt-svg-icon-list-single-fas_check-circle\"><svg style=\"display:inline-block;vertical-align:middle\" viewBox=\"0 0 512 512\" height=\"15\" width=\"15\" fill=\"currentColor\" xmlns=\"http://www.w3.org/2000/svg\" aria-hidden=\"true\"><path d=\"M504 256c0 136.967-111.033 248-248 248S8 392.967 8 256 119.033 8 256 8s248 111.033 248 248zM227.314 387.314l184-184c6.248-6.248 6.248-16.379 0-22.627l-22.627-22.627c-6.248-6.249-16.379-6.249-22.628 0L216 308.118l-70.059-70.059c-6.248-6.248-16.379-6.248-22.628 0l-22.627 22.627c-6.248 6.248-6.248 16.379 0 22.627l104 104c6.249 6.249 16.379 6.249 22.628.001z\"></path></svg></div><span class=\"kt-svg-icon-list-text\">For your safety, Carekleen is fully insured by public liability insurance.</span></li><li class=\"kt-svg-icon-list-style-stacked kt-svg-icon-list-item-wrap kt-svg-icon-list-item-1 kt-svg-icon-list-level-0\"><div style=\"display:inline-flex;justify-content:center;align-items:center;padding:5px;border-width:1px\" class=\"kt-svg-icon-list-single kt-svg-icon-list-single-fas_check-circle\"><svg style=\"display:inline-block;vertical-align:middle\" viewBox=\"0 0 512 512\" height=\"15\" width=\"15\" fill=\"currentColor\" xmln