th=\"15\" fill=\"currentColor\" xmlns=\"http://www.w3.org/2000/svg\" aria-hidden=\"true\"><path d=\"M504 256c0 136.967-111.033 248-248 248S8 392.967 8 256 119.033 8 256 8s248 111.033 248 248zM227.314 387.314l184-184c6.248-6.248 6.248-16.379 0-22.627l-22.627-22.627c-6.248-6.249-16.379-6.249-22.628 0L216 308.118l-70.059-70.059c-6.248-6.248-16.379-6.248-22.628 0l-22.627 22.627c-6.248 6.248-6.248 16.379 0 22.627l104 104c6.249 6.249 16.379 6.249 22.628.001z\"></path></svg></div><span class=\"kt-svg-icon-list-text\">Discounts for recurring clients, complementary addons with annual contracts.</span></li></ul></div>\n<!-- /wp:kadence/iconlist --></div></div>\n<!-- /wp:kadence/column --></div></div></section>\n<!-- /wp:kadence/rowlayout -->\n\n<!-- wp:kadence/rowlayout {\"uniqueID\":\"_719523-67\",\"columns\":1,\"colLayout\":\"equal\",\"htmlTag\":\"section\",\"bgImg\":\"http://carekleen.local/wp-content/uploads/2022/06/pexels-joão-campanholo-7909441-1.png\"} -->\n<section class=\"wp-block-kadence-rowlayout alignnone\"><div id=\"kt-layout-id_719523-67\" class=\"kt-row-layout-inner kt-row-has-bg kt-layout-id_719523-67\"><div class=\"kt-row-column-wrap kt-has-1-columns kt-gutter-default kt-v-gutter-default kt-row-valign-top kt-row-layout-equal kt-tab-layout-inherit kt-m-colapse-left-to-right kt-mobile-layout-row\"><!-- wp:kadence/column {\"uniqueID\":\"_3e687a-36\",\"backgroundImg\":[{\"bgImg\":\"\",\"bgImgID\":\"\",\"bgImgSize\":\"cover\",\"bgImgPosition\":\"center center\",\"bgImgAttachment\":\"scroll\",\"bgImgRepeat\":\"no-repeat\"}]} -->\n<div class=\"wp-block-kadence-column inner-column-1 kadence-column_3e687a-36\"><div class=\"kt-inside-inner-col\"><!-- wp:kadence/advancedheading {\"uniqueID\":\"_9888ad-20\",\"align\":\"center\",\"bottomMargin\":0,\"htmlTag\":\"p\",\"className\":\"section-intro\"} -->\n<p class=\"kt-adv-heading_9888ad-20 section-intro wp-block-kadence-advancedheading\" data-kb-block=\"kb-adv-heading_9888ad-20\">Our Services</p>\n<!-- /wp:kadence/advanced