INSERT INTO `wp_posts` VALUES (104,1,'2022-06-01 21:15:31','2022-06-01 21:15:31','<!-- wp:kadence/rowlayout {\"uniqueID\":\"_3d4c34-c8\",\"columnGutter\":\"none\",\"colLayout\":\"equal\",\"htmlTag\":\"section\",\"minHeight\":55,\"maxWidth\":1200,\"topPadding\":50,\"bottomPadding\":84,\"bgColor\":\"palette1\",\"bgImg\":\"http://carekleen.local/wp-content/uploads/2022/06/bg-slider4-1.png\",\"bottomSep\":\"wave\",\"minHeightUnit\":\"vh\",\"columnsInnerHeight\":true,\"minHeightTablet\":100,\"bgColorClass\":\"theme-palette1\"} -->\n<section class=\"wp-block-kadence-rowlayout alignnone\"><div id=\"kt-layout-id_3d4c34-c8\" class=\"kt-row-layout-inner kt-row-has-bg kt-layout-id_3d4c34-c8 has-theme-palette-1-background-color\"><div class=\"kt-row-column-wrap kt-has-2-columns kt-gutter-none kt-v-gutter-default kt-row-valign-top kt-row-layout-equal kt-tab-layout-inherit kt-m-colapse-left-to-right kt-mobile-layout-row kt-inner-column-height-full\"><!-- wp:kadence/column {\"uniqueID\":\"_277e48-bf\",\"textAlign\":[\"left\",\"\",\"\"],\"direction\":[\"vertical\",\"\",\"\"],\"justifyContent\":[\"\",\"\",\"\"]} -->\n<div class=\"wp-block-kadence-column inner-column-1 kadence-column_277e48-bf\"><div class=\"kt-inside-inner-col\"><!-- wp:heading {\"level\":1,\"textColor\":\"theme-palette9\"} -->\n<h1 class=\"has-theme-palette-9-color has-text-color\">Industrial &amp; commercial cleaning services that you can trust.</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":\"21px\"}},\"textColor\":\"theme-palette9\"} -->\n<p class=\"has-theme-palette-9-color has-text-color\" style=\"font-size:21px\">Residential &amp; commercial cleaning services that you can trust. We are committed to the best quality in industrial cleaning, residential cleaning, and garden cleaning.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:block {\"ref\":47} /--></div></div>\n<!-- /wp:kadence/column -->\n\n<!-- wp:kadence/column {\"id\":2,\"uniqueID\":\"_12ce61-76\"} -->\n<div class=\"wp-